const unsigned char *Wave;
unsigned long Length;
int increment;

void Play(void){
  if (Length) {
    DAC_Out(*Wave);
    Wave += increment;
    Length--;
  } else {
    TIMER1_CTL_R &= ~0x00000001; // disable TIMER1A
  }
}
void Sound_Init(void){
  Length = 0;
  DAC_Init();               // initialize simple 4-bit DAC
  Timer1_Init(&Play, 80000000/11025);     // 11.025 kHz
}

void Sound_Play(const unsigned char *pt, unsigned long count){
  Wave = pt;
  Length = count;
  TIMER1_CTL_R |= 0x00000001;    // enable TIMER1A
}
void flohwalzerSound(enum Direction dir) {
  if (dir == FORWARDS) {
    increment = 1;
    Sound_Play(flohwalzer, sizeof(flohwalzer));
  } else {
    increment = -1;
    Sound_Play(flohwalzer+sizeof(flohwalzer)-1, sizeof(flohwalzer));
  }
}

